import NavBar from "../../components/navbar/index.jsx";
import Footer from "../../components/footer/index.jsx";
import Estabelecimento from "../../components/estabelecimento/index.jsx"

function Home() {
  return (
    <>
      <NavBar />
      <Estabelecimento nome="Burguer King" avaliacao="4.7"/>      
      <Estabelecimento nome="Mc Donalt's"/>
      <Estabelecimento nome="Habib's"/>
      <Estabelecimento nome="Subway"/>
      <Footer />
    </>
  );
}

export default Home;
